            <input type="text" id="nev" placeholder="felhasználónév..." value={this.nev} name="nev"/><br /><br />
            <input type="password" id="password" placeholder="jelszó..." value={this.password} name="password"/><br /><br />
            <button onClick={(e) => getData()} >Login</button>
          </div>
        </form>
    );
}
export default Login;
